  ?royalParent1 dbp:spouse ?spouse .

  {
    # Step 4: Identify the child of Frederick Francis III, Grand Duke of Mecklenburg-Schwerin
    ?childFrederick dbp:parent ?grandChildParent ;
                    dbp:father "Frederick Francis III, Grand Duke of Mecklenburg-Schwerin"@en .

    # Step 5: Identify the child of this child who is a royalty
    ?royalGrandChild dbp:parent ?childFrederick ;
